<script type="text/javascript">
$(function(){

	var panel = $('<div id="panel" class="hide"></div>');
	$('#container').append(panel);
	$('path').hover(function(e){
		var district = $(this).attr('ndistricte');
		var nivel = $(this).attr('nivell');
		var d = {'district':district, 'nivel':nivel};
		var txt ='<strong>District:</strong><em> '+district+'</em><br /><strong>Level:</strong> '+nivel;
		var x = e.offsetX;
		var y = e.offsetY;
		panel.removeClass('hide');
		panel.html(txt);
		panel.offset({top:y, left:x + 24});
	});
	$('path').mouseleave(function(e){
		panel.addClass('hide');
	});
});</script>
